--------------------------------------------------------
--  DDL for Table AFP
--------------------------------------------------------
CREATE TABLE AFP (
  IDAFP NUMBER(1,0) NOT NULL,
  NOMAFP VARCHAR2(20) NOT NULL,
  PORC NUMBER(5,2) NOT NULL,
  CONSTRAINT PK_AFP PRIMARY KEY (IDAFP)
);
--------------------------------------------------------
--  DDL for Table ASESORIA
--------------------------------------------------------

CREATE TABLE ASESORIA (
  RUTPROF VARCHAR2(10) NOT NULL,
  IDEMPRESA NUMBER NOT NULL, 
  HONORARIO NUMBER NOT NULL
    CONSTRAINT CKC_SUELDO_ASESORIA CHECK (HONORARIO IS NULL OR (HONORARIO <= 1000000)),  
  INICIO DATE NOT NULL, 
  FIN DATE NOT NULL,
  CONSTRAINT PK_ASESORIA PRIMARY KEY (RUTPROF, IDEMPRESA, INICIO)
);
--------------------------------------------------------
--  DDL for Table CARTOLA_PROFESIONALES
--------------------------------------------------------

CREATE TABLE CARTOLA_PROFESIONALES (
 RUT_PROFESIONAL VARCHAR2(10) NOT NULL,
 NOMBRE_PROFESIONAL VARCHAR2(50) NOT NULL,
 PROFESION VARCHAR2(25) NOT NULL,
 ISAPRE VARCHAR2(25),
 SUELDO_BASE NUMBER(8) NOT NULL,
 PORC_COMISION_PROFESIONAL NUMBER(2,2) NOT NULL,
 VALOR_TOTAL_COMISION NUMBER(8) NOT NULL,
 PORCENTATE_HONORARIO NUMBER(8) NOT NULL,
 BONO_MOVILIZACION NUMBER(6) NOT NULL,
 TOTAL_PAGAR NUMBER(8) NOT NULL
 );

--------------------------------------------------------
--  DDL for Table COMUNA
--------------------------------------------------------

CREATE TABLE COMUNA (
  CODCOMUNA NUMBER NOT NULL, 
  NOMCOMUNA VARCHAR2(20) NOT NULL,
  CONSTRAINT PK_COMUNA PRIMARY KEY (CODCOMUNA)
);
--------------------------------------------------------
--  DDL for Table EMPRESA
--------------------------------------------------------

CREATE TABLE EMPRESA (
  IDEMPRESA NUMBER NOT NULL,
  RUT_EMPRESA NUMBER(8) NOT NULL,
  DV_EMPRESA VARCHAR2(1) NOT NULL,  
  CODCOMUNA NUMBER NOT NULL, 
  CODSECTOR NUMBER NOT NULL, 
  NOMEMPRESA VARCHAR2(40) NOT NULL,
  IVA_DECLARADO NUMBER(8) NOT NULL,
  FECHA_INICIACION_ACTIVIDADES DATE NOT NULL,
  CONSTRAINT PK_EMPRESA PRIMARY KEY (IDEMPRESA)
);

--------------------------------------------------------
--  DDL for Table ISAPRE
--------------------------------------------------------

CREATE TABLE ISAPRE (
  IDISAPRE NUMBER(1,0) NOT NULL, 
  NOMISAPRE VARCHAR2(20) NOT NULL,
  CONSTRAINT PK_ISAPRE PRIMARY KEY (IDISAPRE)
);

--------------------------------------------------------
--  DDL for Table PROFESION
--------------------------------------------------------

CREATE TABLE PROFESION (
  IDPROFESION NUMBER NOT NULL, 
  NOMPROFESION VARCHAR2(25) NOT NULL, 
  ASIGNACION NUMBER(5,2) NOT NULL,
  CONSTRAINT PK_PROFESION PRIMARY KEY (IDPROFESION)
);

--------------------------------------------------------
--  DDL for Table PROFESIONAL
--------------------------------------------------------

CREATE TABLE PROFESIONAL (
  ID NUMBER(3),
  RUTPROF VARCHAR2(10) NOT NULL, 
  CODCOMUNA NUMBER NOT NULL, 
  IDPROFESION NUMBER NOT NULL, 
  APPPRO VARCHAR2(15) NOT NULL, 
  APMPRO VARCHAR2(15) NOT NULL, 
  NOMPRO VARCHAR2(20) NOT NULL, 
  ECIVPER VARCHAR2(15) NOT NULL
    CONSTRAINT CKC_ECIVPER_PROFESIONAL CHECK (ECIVPER IN ('Soltero','Casado','Divorciado','Viudo')), 
  SUELDO NUMBER(8) NOT NULL,
  COMISION NUMBER(2,2),
  IDAFP NUMBER(1) NOT NULL, 
  IDISAPRE NUMBER(1) NOT NULL,
  IDTCONTRATO NUMBER(1),
  CONSTRAINT PK_PROFESIONAL PRIMARY KEY (RUTPROF)
);

--------------------------------------------------------
--  DDL for Table SECTOR
--------------------------------------------------------

CREATE TABLE SECTOR (
  CODSECTOR NUMBER NOT NULL, 
  NOMSECTOR VARCHAR2(20) NOT NULL,
  CONSTRAINT PK_SECTOR PRIMARY KEY (CODSECTOR)
);

CREATE TABLE RANGOS_SUELDOS (
  IDRANGO NUMBER(2) NOT NULL,
  S_MIN NUMBER(8) NOT NULL,
  S_MAX NUMBER(8) NOT NULL, 
  HONOR_PCT NUMBER(4,2) NOT NULL, 
  CONSTRAINT PK_RANGOS PRIMARY KEY (IDRANGO)
);  

CREATE TABLE TIPO_CONTRATO (
   IDTCONTRATO NUMBER(1) NOT NULL,
   NOMTCONTRATO VARCHAR2(30) NOT NULL,
   INCENTIVO NUMBER(2) NOT NULL,
  CONSTRAINT PK_TIPOCONTRATO PRIMARY KEY (IDTCONTRATO)   
);
  
ALTER TABLE EMPRESA
   ADD CONSTRAINT FK_EMPRESA_PERTENECE_SECTOR FOREIGN KEY (CODSECTOR)
      REFERENCES SECTOR (CODSECTOR);
      
ALTER TABLE EMPRESA
   ADD CONSTRAINT FK_EMPRESA_UBICA_COMUNA FOREIGN KEY (CODCOMUNA)
      REFERENCES COMUNA (CODCOMUNA);

ALTER TABLE PROFESIONAL
   ADD CONSTRAINT FK_PROFESIONAL_VIVE_COMUNA FOREIGN KEY (CODCOMUNA)
      REFERENCES COMUNA (CODCOMUNA);

ALTER TABLE PROFESIONAL
   ADD CONSTRAINT FK_PROFESIONAL_PROFESION FOREIGN KEY (IDPROFESION)
      REFERENCES PROFESION (IDPROFESION);

ALTER TABLE PROFESIONAL
   ADD CONSTRAINT FK_AFP_PROFESIONAL FOREIGN KEY (IDAFP)
      REFERENCES AFP (IDAFP);

ALTER TABLE PROFESIONAL
   ADD CONSTRAINT FK_ISAPRE_PROFESIONAL FOREIGN KEY (IDISAPRE)
      REFERENCES ISAPRE (IDISAPRE);

ALTER TABLE PROFESIONAL
   ADD CONSTRAINT FK_TCONTRATO_PROFESIONAL FOREIGN KEY (IDTCONTRATO)
      REFERENCES TIPO_CONTRATO (IDTCONTRATO);

ALTER TABLE ASESORIA
   ADD CONSTRAINT FK_ASESORIA_PROFESIONAL FOREIGN KEY (RUTPROF)
      REFERENCES PROFESIONAL (RUTPROF);

ALTER TABLE ASESORIA
   ADD CONSTRAINT FK_ASESORIA_EMPRESA FOREIGN KEY (IDEMPRESA)
      REFERENCES EMPRESA (IDEMPRESA);
 
CREATE SEQUENCE PROFESIONAL_SEQ
INCREMENT BY 1 
START WITH 1 
MAXVALUE 99999999
MINVALUE 1;

COMMIT;



--------------------------------------------------------------------------------
-- POBLADO DE TABLAS
--------------------------------------------------------------------------------
CREATE TABLE AUDITOR AS SELECT * FROM PROFESIONAL WHERE IDPROFESION IN (1,2) AND SUELDO  <  350000;
CREATE TABLE CONTADOR AS SELECT * FROM PROFESIONAL WHERE IDPROFESION = 2;
CREATE TABLE INFORMATICO AS SELECT * FROM PROFESIONAL WHERE IDPROFESION = 3;
CREATE TABLE PREVENCIONISTA AS SELECT * FROM PROFESIONAL WHERE IDPROFESION = 4;
CREATE TABLE OTROS_PROFESIONALES AS SELECT * FROM PROFESIONAL WHERE IDPROFESION IN (4,6) AND SUELDO  <  350000;

COMMIT;

UPDATE empresa 
   SET FECHA_INICIACION_ACTIVIDADES = add_months(FECHA_INICIACION_ACTIVIDADES,12);

UPDATE asesoria 
   SET INICIO = inicio + INTERVAL '4' YEAR, 
       FIN = fin + INTERVAL '4' YEAR;
       
COMMIT;